import React from "react";
// import "./TodosLoading.css"


function TodosLoading() {
  return (
    <div class="typing-indicator">
    <div class="typing-circle"></div>
    <div class="typing-circle"></div>
    <div class="typing-circle"></div>
    <div class="typing-shadow"></div>
    <div class="typing-shadow"></div>
    <div class="typing-shadow"></div>
</div>
  );
}

export { TodosLoading };
